import React from 'react';
import Col from 'react-bootstrap/Col';
import Image from 'react-bootstrap/Image';
import fotoPerfil from './foto.jpg';

export default function Foto(){
    return (
        <div>
             <Col xs={6} md={4}>
              <Image src={fotoPerfil} roundedCircle />
             </Col>
        </div>
    )

}
